A little something for you all during the warm up to the Durrell Challenge. Now, I'm fairly sure that some of the lines in this video are scripted, although I actually have met a child who fancied eating slugs....not saying it was James Haskell, but it might have been. Regardless of some questionable life choices for humans, this is indeed heart warming and also a little sad. In truth, it shows how important Durrell really is. These are just some of the species that Durrell is working incredibly hard to help survive looming extinction. I know that I don't want the little gems in that video to be the last ones when they grow up, which is why I do what I do. If you want to have a go too, we have the Durrell Challenge coming up. Check out the link in my bio to see how you can take part from your home town. 
